import React, { Component } from "react";

class Experience extends Component {
  render() {
    return (
      <div id="container">
        <h2>Experience</h2>
        <div class="row">
          <div class="col-md-4">
          </div>
          <div class="col-md-8">
          </div>
        </div>
        <div class="row">
          <div class="col-md-12">
          </div>
        </div>
      </div>
    );
  }
}

export default Experience;
